import React, { useState, useEffect } from "react";

// Mock data to simulate API responses

const mockNewsTypes = [
  "general",
  "dataBreach",
  "cyberAttack",
  "vulnerability",
  "malware",
  "security",
  "cloud",
  "tech",
  "iot",
  "bigData",
  "business",
  "mobility",
  "research",
  "socialMedia",
  "corporate",
];

const mockNewsList = {
  general: [
    {
      id: 123456,
      headlines: "Next-gen tech shaping cybersecurity landscape",
      author: "Jane Doe",
      newsDate: "Aug 31 2025",
      newsImgURL:
        "https://ciosea.economictimes.indiatimes.com/photo1.jpg",
      fullNews:
        "Emerging technologies such as AI and quantum computing are transforming cybersecurity defense strategies...",
      newsURL: "https://ciosea.economictimes.indiatimes.com/news/next-gen-technologies/article1",
    },
    {
      id: 123457,
      headlines: "Internet trends driving new cybersecurity challenges",
      author: "John Smith",
      newsDate: "Aug 30 2025",
      newsImgURL:
        "https://telecom.economictimes.indiatimes.com/photo2.jpg",
      fullNews:
        "As internet use expands, novel vulnerabilities appear demanding innovative solutions...",
      newsURL: "https://telecom.economictimes.indiatimes.com/news/internet/article2",
    },
  ],

  dataBreach: [
    {
      id: 223456,
      headlines: "Recent data breach exposes millions of accounts",
      author: "Alice Johnson",
      newsDate: "Aug 29 2025",
      newsImgURL:
        "https://thehackernews.com/images/databreach1.jpg",
      fullNews:
        "A major company suffered a data breach that compromised sensitive user information...",
      newsURL: "https://thehackernews.com/search/label/data%20breach/article3",
    },
  ],

  // Add other newsType categories with sample news as needed.
};

function CyberNewsApp() {
  const [newsTypes, setNewsTypes] = useState([]);
  const [selectedType, setSelectedType] = useState("");
  const [newsList, setNewsList] = useState([]);
  const [loading, setLoading] = useState(false);

  // Load mock news types on mount
  useEffect(() => {
    // Simulate API delay with setTimeout
    setLoading(true);
    setTimeout(() => {
      setNewsTypes(mockNewsTypes);
      setLoading(false);
    }, 500);
  }, []);

  // Load news articles when a news type is selected
  useEffect(() => {
    if (!selectedType) {
      setNewsList([]);
      return;
    }
    setLoading(true);
    // Simulate API delay
    setTimeout(() => {
      const newsData = mockNewsList[selectedType] || [];
      setNewsList(newsData);
      setLoading(false);
    }, 700);
  }, [selectedType]);

  return (
    <div style={{ maxWidth: "800px", margin: "20px auto", fontFamily: "Arial, sans-serif" }}>
      <h1>Cyber Security News</h1>

      <div style={{ marginBottom: "15px" }}>
        <label htmlFor="newsTypeSelect" style={{ marginRight: "10px" }}>
          Select News Type:
        </label>
        <select
          id="newsTypeSelect"
          value={selectedType}
          onChange={(e) => setSelectedType(e.target.value)}
          style={{ padding: "6px 12px", fontSize: "16px" }}
        >
          <option value="">-- Choose --</option>
          {newsTypes.map((type) => (
            <option key={type} value={type}>
              {type}
            </option>
          ))}
        </select>
      </div>

      {loading && <p>Loading...</p>}

      {!loading && selectedType && newsList.length === 0 && (
        <p>No news found for "{selectedType}".</p>
      )}

      <div>
        {newsList.map((news) => (
          <div
            key={news.id}
            style={{
              borderBottom: "1px solid #ccc",
              paddingBottom: "15px",
              marginBottom: "15px",
            }}
          >
            <h3>{news.headlines}</h3>
            <p>
              <strong>Author:</strong> {news.author}
            </p>
            <p>
              <strong>Date:</strong> {news.newsDate}
            </p>
            {news.newsImgURL && (
              <img
                src={news.newsImgURL}
                alt="news"
                style={{ maxWidth: "100%", height: "auto", marginBottom: "10px" }}
              />
            )}
            <p>{news.fullNews}</p>
            <a href={news.newsURL} target="_blank" rel="noopener noreferrer">
              Read full article
            </a>
          </div>
        ))}
      </div>
    </div>
  );
}

export default CyberNewsApp;
